// Material Dashboard 2 React layouts
import Dashboard from "layouts/dashboard";
import { useNavigate } from "react-router-dom";
import MDButton from "components/MDButton";
import Icon from "@mui/material/Icon";
import MDTypography from "components/MDTypography";
import MDBox from "components/MDBox";

// Pages
import Trima from "layouts/trima";
import Example from "layouts/tables";

//Examples
import Tables from "layouts/tables";
import Profile from "layouts/profile";
import Notifications from "layouts/notifications";
import SignIn from "layouts/authentication/sign-in";

// @mui icons
import NotificationsActiveIcon from "@mui/icons-material/NotificationsActive";

//Custm Icons
import ReveosIcon from "components/CustomIcons/Reveos";
import TRACIcon from "components/CustomIcons/TRAC";
import TrimaIcon from "components/CustomIcons/Trima";
import ArchimedeIcon from "components/CustomIcons/Archimede";

const LogoutButton = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    console.log("Logout clicado");
    localStorage.removeItem("authToken");
    console.log("Token removido:", localStorage.getItem("authToken"));
    navigate("/authentication/sign-in");
  };

  return (
    <MDBox
      display="flex"
      alignItems="center"
      onClick={handleLogout}
      style={{
        cursor: "pointer",
        padding: "10px 15px",
        borderRadius: "4px",
        "&:hover": { backgroundColor: "#f5f5f5" },
      }}
    >
      <Icon fontSize="small" style={{ marginRight: "8px" }}>
        logout
      </Icon>
      <MDTypography variant="body1" color="textPrimary">
        Logout
      </MDTypography>
    </MDBox>
  );
};

const routes = [
  {
    type: "collapse",
    name: "Dashboard",
    key: "dashboard",
    icon: <Icon fontSize="small">dashboard</Icon>,
    route: "/dashboard",
    component: <Dashboard />,
  },
  {
    type: "collapse",
    name: "Trima",
    key: "trima",
    icon: <TrimaIcon />,
    route: "/dashboard/trima",
    component: <Trima />,
  },
  {
    type: "collapse",
    name: "Reveos",
    key: "reveos",
    icon: <ReveosIcon />,
    route: "/rlt",
    component: <Example />,
  },
  {
    type: "collapse",
    name: "T-RAC",
    key: "trac",
    icon: <TRACIcon />,
    route: "/dashboard",
    component: <Trima />,
  },
  {
    type: "collapse",
    name: "Archimede",
    key: "archimede",
    icon: <ArchimedeIcon />,
    route: "/dashboard",
    component: <Trima />,
  },
  {
    type: "collapse",
    name: "Notificações",
    key: "notificacoes",
    icon: <NotificationsActiveIcon />,
    route: "/dashboard",
    component: <Trima />,
  },
  {
    type: "collapse",
    name: "Logout",
    key: "logout",
    icon: <LogoutButton />,
  },
];

export default routes;
